import Layout from "../components/Layout";

import { Grid, Typography } from "@material-ui/core";

const About = () => (
  <Layout>
    <Grid container>
      <Grid item lg={2}></Grid>

      <Grid
        item
        lg={8}
        style={{ marginTop: 60, backgroundColor: "#eee", height: "100%" }}
      >
        <div>
          <Typography variant="h2">About Tomato</Typography>
        </div>
      </Grid>

      <Grid item lg={2}></Grid>
    </Grid>
  </Layout>
);

export default About;
